svg.script:
		function zoomTarget1() {
			var svgDocument = document.getElementsByTagName('svg')[0];
			var cx = 150;
			var cy = 610;
			var width = 525;
			svgDocument.setAttribute("viewBox", cx+" "+cy+" "+width+" 300");
			showReturnButton(cx,cy,width); 	
		}

		function zoomTarget2() {
			var svgDocument = document.getElementsByTagName('svg')[0];
			var cx = 630;
			var cy = 90;
			var width = 450;
			svgDocument.setAttribute("viewBox", cx+" "+cy+" "+width+" 350");
			
			showReturnButton(cx,cy, width);
		}
		
		
		
		function showReturnButton(cx, cy, width) {
			var svgDocument = document.getElementsByTagName('svg')[0];
			var exitButton = svgDocument.getElementById('exitButton');
			exitButton.setAttribute("display","block");
			//if (cx != 150) {
				exitButton.setAttribute("transform","translate("+(cx+width-50)+","+cy+")");
			/*} else {
				exitButton.setAttribute("transform","translate("+(cx+width-75)+","+(cy+15)+")");
			}*/
			exitButton.addEventListener("click",
				function() {
					svgDocument.setAttribute("viewBox", "60 100 1050 800");
					exitButton.setAttribute("display","none");
				}, 
			false);
			
		}
